import styled from "styled-components";

export const StyledCostFooter = styled.div`

    display: flex;
    align-items: center;
    width: 1900px;
    height: 30px ;
    background-color: #e4e4e7;
    border: 1px solid black;
    border-radius: 5px;
    margin: 10px;
    margin: left: 15px;

    div {
        margin: 5px;
        font-weight: 450;
    }

`;
